Cloud: Challenge of the Stallions (PBS)

Nature Documentary hosted by Ginger Kathrens, published by PBS broadcasted as part of PBS Nature series in 2009 - English narration


Information
------------------------------

The continuing saga of Cloud, the wild, white stallion, returns viewers to the Arrowhead Mountains of Montana. Cloud is now a confident band stallion in his prime. As he rules the mountains, gathering mares and expanding his reign, the story turns to his two sons, Bolder is his by birth and Flint, sired by another stallion. Who will rise to challenge the mighty Cloud? Will nature or nurture produce the next great stallion of the Arrowheads?

